  true,\n\t\"url\": null,\n\t\"notes\": \"The data sets are outputs from the WRF-CMAQ
  modeling system. Typically these files contain a number of meteorological and atmospheric
  pollutant concentrations on a model grid which is either 2- or 3-dimensional and
  also in some instances vary with time. nnThis dataset is associated with the following
  publication:nXing, J., R. Mathur , J. Pleim , C. Hogrefe , C. Gan, D. Wong , C.
  Wei, and J. Wang. Air pollution and climate response to aerosol direct radiative
  effects: A modeling study of decadal trends across the northern hemisphere.   JOURNAL
